import React, {Component} from 'react';
import MandalArtTable from "./MandalArtTable";

class MandalArtTemplate extends Component {
    constructor(props) {
        super(props);
        this.state = {

            MandalArtData: [
                {table1: []},
                {table2: []},
                {table3: []},
                {table4: []},
                {table5: []},
                {table6: []},
                {table7: []},
                {table8: []},
                {table9: []}
            ]
        };
    }

    render() {
        return (
            <section>
                <div>만다라트</div>
                <div>
                    {this.state.MandalArtData.map((data, idx) => {
                        return (
                            <MandalArtTable/>
                        );
                    })}
                </div>
            </section>
        )
    }
}

export default MandalArtTemplate;
